import React,{useState,useEffect} from 'react';
const siemPieChart = () => {
    const [pieChartData, setPieChartData] = useState({
        data: {
          rule_description: [],
          bg_count: [],
          Color_codes: [],
          status: ''
        }
      });
  
    useEffect(() => {
      fetchData();
    }, []);
  
    const fetchData = async () => {
      try {
        const response = await fetch("http://localhost:3001/get-pie_chart");
        const pieChartData = await response.json();
        console.log(pieChartData);
        setPieChartData(pieChartData);
      } catch (error) {
        console.error(error);
      }
    };
  
    return (
        <div>
            {}

        </div>
    )
};

export default siemPieChart
